const Greeting = (props) => {

    let obtainData = async () => {
        let crude = await fetch('https://jsonplaceholder.typicode.com/users');
        await crude.json()
        console.log(crude)
    }


    useEffect(async () => { await obtainData()})

    return(
        <Fragment>
            hello!
        </Fragment>
    )
}

export default Greeting;
